/**
 * @file
 * dropzonejs_eb_widget.common.js
 *
 * Bundles various dropzone eb widget behaviours.
 */

(function ($, Drupal, drupalSettings) {
  'use strict';

  Drupal.behaviors.dropzonejsPostIntegrationEbWidgetCommon = {
    attach: function (context) {
      if (typeof drupalSettings.dropzonejs.instances !== 'undefined') {
        _.each(drupalSettings.dropzonejs.instances, function (item) {
          var $form = $(item.instance.element).parents('form');

          if ($form.hasClass('dropzonejs-disable-submit')) {
            var $submit = $form.find('.is-entity-browser-submit');
            $submit.prop('disabled', true);

            item.instance.on('queuecomplete', function () {
              if (item.instance.getRejectedFiles().length === 0) {
                $submit.prop('disabled', false);
              }
              else {
                $submit.prop('disabled', true);
              }
            });

            item.instance.on('removedfile', function () {
              if (item.instance.getRejectedFiles().length === 0) {
                $submit.removeAttr('disabled');
              }

              // If there are no files in DropZone -> disable Button.
              if (item.instance.getAcceptedFiles().length === 0) {
                $submit.prop('disabled', true);
              }
            });

            if (drupalSettings.entity_browser_widget && drupalSettings.entity_browser_widget.auto_select) {
              item.instance.on('queuecomplete', function () {
                var dzInstance = item.instance;
                var filesInQueue = dzInstance.getQueuedFiles();
                var acceptedFiles;
                var i;

                if (filesInQueue.length === 0) {
                  acceptedFiles = dzInstance.getAcceptedFiles();

                  // Ensure that there are some files that should be submitted.
                  if (acceptedFiles.length > 0 && dzInstance.getUploadingFiles().length === 0) {
                    // First submit accepted files and clear them from list of
                    // dropped files afterwards.
                    $form.find('[id="auto_select_handler"]')
                      .trigger('auto_select_enity_browser_widget');

                    // Remove accepted files -> because they are submitted.
                    for (i = 0; i < acceptedFiles.length; i++) {
                      dzInstance.removeFile(acceptedFiles[i]);
                    }
                  }
                }
              });
            }

          }
        });
      }
    }
  };

}(jQuery, Drupal, drupalSettings));
;
/**
 * @file Entity_browser.admin.js.
 *
 * Defines the behavior of the entity browser's tab display.
 */

(function ($, Drupal, drupalSettings) {

  'use strict';

  /**
   * Registers behaviours related to tab display.
   */
  Drupal.behaviors.entityBrowserTabs = {
    attach: function (context) {
      var $form = $(context).find('.entity-browser-form').once('entity-browser-admin');
      if (!$form.length) {
        return;
      }

      var $nav = $('<nav class="eb-tabs"></nav>');
      var $tabs = $(Drupal.theme('entityTabs'));

      $form.find('.tab').each(function (index, element) {
        var $element = $(element);
        var classesArray = [];
        classesArray.push($element.attr('disabled') ? 'is-active active' : '');
        var text = $element.text();
        var textClass = text.toLowerCase().replace(/ /g, '-');
        classesArray.push(textClass);
        var classes = classesArray.join(' ');
        var tabSettings = {
          class: classes,
          id: $element.attr('id'),
          title: $(this)[0].value
        };
        var $tab = $(Drupal.theme('entityTab', tabSettings));

        // Add a click event handler that submits the hidden input buttons.
        $tab.find('a').on('click', function (event) {
          var buttonID = $(event.currentTarget).data().buttonId;
          $form.find('#' + buttonID).trigger('click');
          event.preventDefault();
        });
        $tab.appendTo($tabs);
      });
      $tabs.appendTo($nav);
      $nav.prependTo($form);
      $form.find('.tab').css('display', 'none');
    }
  };

  /**
   * Theme function for entity browser tabs.
   *
   * @return {object}
   *   This function returns a jQuery object.
   */
  Drupal.theme.entityTabs = function () {
    return $('<ul role="navigation" aria-label="Tabs"></ul>');
  };

  /**
   * Theme function for an entity browser tab.
   *
   * @param {object} settings
   *   An object with the following keys:
   * @param {string} settings.title
   *   The name of the tab.
   * @param {string} settings.class
   *   Classes for the tab.
   * @param {string} settings.id
   *   ID for the data- button ID.
   *
   * @return {object}
   *   This function returns a jQuery object.
   */
  Drupal.theme.entityTab = function (settings) {
    return $('<li tabindex="-1"></li>')
      .addClass(settings.class)
      .append($('<a href="#"></a>').addClass(settings.class).attr('data-button-id', settings.id)
      .append(settings.title)
    );
  };

}(jQuery, Drupal, drupalSettings));
;
